import SearchResults from "./components/SearchResults";
import Container from "./components/Container";

const App = () => {
  return (
    <Container>
      {({
        onSearchChange,
        queryError,
        status,
        onDelete,
        onSelect,
        partyMorty,
        partyRick,
        searchValue,
        displayedCharacters,
      }: any) => (
        <>
          <div className="App">
            <input
              placeholder="Enter a character name"
              onChange={onSearchChange}
              value={searchValue}
            />
          </div>
          <SearchResults
            characters={displayedCharacters}
            status={status}
            queryError={queryError}
            onDelete={onDelete}
            onSelect={onSelect}
          />
        </>
      )}
    </Container>
  );
};

export default App;
